INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (6055, 718, 1177, '2018-04-20 00:00:00', '11:02', 'O decreto foi realizado analisando este tpico.\r\n\r\nA partir do momento que o Moderador Felipe Santos adiou a rodada, apenas os comentrios em sequncia foram vlidos, como no houve comentrios por parte do tcnico Villarreal, foi dado WO em favor do tcnico do Southampton.\r\n\r\nAo revisar este decreto, vi que o tcnico rodrigofifa78 tentou realizar a marcao no tpico do jogo da VOLTA, no tpico em questo, houve um WO em favor do tcnico do Villarreal.\r\n\r\nNo regulamento consta: Em jogos de MataxMata com sistema de ida e volta, o tcnico que perder por WO no jogo de volta, seja por omisso parcial ou total, independentemente do resultado do jogo de ida, fica automaticamente desclassificado.\r\n\r\nConcluindo:\r\n\r\nHouve um erro de minha parte ao decretar a segunda partida deste confronto. Levei em considerao apenas o tpico do jogo de ida. Lamento o ocorrido e peo sinceras desculpas aos dois tcnicos, principalmente rodrigofifa78. \r\n\r\nAbrao', 'HugoSiqueira94');
